import backgroundImage from './img/bg.png';
import Header from './components/header';
impo
import About from './components/about';

function App() {
  return (
    <div className="bg-blue-200 bg-cover bg-center h-screen w-screen px-60 py-4" 
      style={{
        backgroundImage: "url(${backgroundImage})",
        backgroundSize: 'cover',
        backgroundPosition: 'center'
      }}
    >
      <div className='bg-purple-50 h-full rounded-lg text-dark font-mono drop-shadow-md border'>
        <div className='w-full bg-white backdrop-blur-sm rounded-t-lg text-center py-1'>
          <p className='font-semibold text-sm'>BRING YOUR VISIONS TO LIFE</p>
        </div>
        <Header />
        <About />
      </div>
    </div>
  );
}

export default App;
